BEGIN TRANSACTION;
CREATE TABLE analysis_cache (
    id INTEGER PRIMARY KEY AUTOINCREMENT,
    board_hash TEXT NOT NULL,
    moves_sequence TEXT,
    board_size INTEGER NOT NULL,
    komi REAL NOT NULL,
    analysis_result TEXT NOT NULL,
    engine_visits INTEGER NOT NULL,
    model_name TEXT NOT NULL,
    created_at TIMESTAMP DEFAULT CURRENT_TIMESTAMP
, calculation_duration REAL, stopped_by_limit INTEGER, limit_setting TEXT);
DELETE FROM "sqlite_sequence";
CREATE INDEX idx_board_hash ON analysis_cache(board_hash);
CREATE UNIQUE INDEX idx_board_hash_visits_komi ON analysis_cache(board_hash, engine_visits, komi);
COMMIT;
